import React from "react";
import Box from '@mui/material/Box';
import './ChatPage.css'

const ChatPage = () => {
    <Box
        height={200}
        width={200}
        my={4}
        display="flex"
        alignItems="center"
        gap={4}
        p={2}
        sx={{ border: '2px solid black' }}
    >

    </Box>
}

export default ChatPage
